import React, { useState, useEffect } from 'react';
import { getSingleBluebookApi, updateBluebookApi, deleteBluebookApi } from "../../apis/Api";
import { useParams, useNavigate } from 'react-router-dom';
import { toast } from "react-toastify";
import "./BluebookDetails.css";
import ConfirmationMessage from './ConfirmationMessage'; 

const BluebookDetails = () => {
  const { bluebookId } = useParams();
  const navigate = useNavigate();
  const [bluebook, setBluebook] = useState(null);
  const [formData, setFormData] = useState(null);
  const [confirmationVisible, setConfirmationVisible] = useState(false); 
  const [bluebookToDelete, setBluebookToDelete] = useState(null); 

  useEffect(() => {
    fetchBluebookDetails();
  }, [bluebookId]);

  const fetchBluebookDetails = async () => {
    try {
      const response = await getSingleBluebookApi(bluebookId);
      setBluebook(response.data.bluebook);
      // Separate initial values from updated form data
      setFormData(response.data.bluebook);
    } catch (error) {
      console.error('Error fetching bluebook details:', error);
      toast.error('Error fetching bluebook details');
    }
  };

  const handleChange = (e) => {
    const { name, value } = e.target;
    setFormData(prevState => ({
      ...prevState,
      [name]: value
    }));
  };

  const handleUpdate = async () => {
    try {
      // Only send updates for Tax Paid and Valid Up to fields
      const { taxPaid, validUpTo } = formData;
      await updateBluebookApi(bluebookId, { taxPaid, validUpTo });
      toast.success('Bluebook details updated successfully');
      navigate();
    } catch (error) {
      console.error('Error updating bluebook details:', error);
      toast.error('Error updating bluebook details');
    }
  };

  const handleDeleteConfirmation = (bluebook) => {
    setBluebookToDelete(bluebook);
    setConfirmationVisible(true);
  };

  const handleDelete = async () => {
    try {
      await deleteBluebookApi(bluebookToDelete.bluebookId);
      toast.success('Bluebook deleted successfully');
      navigate('/dashboards');
    } catch (error) {
      console.error('Error deleting bluebook:', error);
      toast.error('Error deleting bluebook');
    } finally {
      setConfirmationVisible(false);
      setBluebookToDelete(null);
    }
  };

  const handleCancelDelete = () => {
    setConfirmationVisible(false);
    setBluebookToDelete(null);
  };

  if (!bluebook) {
    return <div>Loading...</div>;
  }

  return (
    <div className="bluebook-details">
      <h2>Bluebook Details</h2>
      <div className="bluebook-info">
        <p><strong>Owner Name:</strong> {bluebook.bluebookName}</p>
        <p><strong>Registration Authority:</strong> {bluebook.registrationAuthority}</p>
        <p><strong>Vehicle Class (CC):</strong> {bluebook.vehicleClass}</p>
        <p><strong>Fuel Type:</strong> {bluebook.fuelType}</p>
        <p><strong>Vehicle Manufactured Year:</strong> {bluebook.vehicleManufactured}</p>
        <p><strong>Tax Paid:</strong> <input type="date" value={formData.taxPaid} onChange={handleChange} name="taxPaid" /></p>
        <p><strong>Valid Up To:</strong> <input type="date" value={formData.validUpTo} onChange={handleChange} name="validUpTo" /></p>
        <p><strong>Chassis Number:</strong> {bluebook.chassisNumber}</p>
        <p><strong>Engine Number:</strong> {bluebook.engineNumber}</p>
      </div>
      <div className="button-group">
        <button type="button" onClick={handleUpdate}>Update</button>
        <button type="button" onClick={() => handleDeleteConfirmation(bluebook)}>Delete</button>
      </div>
      {/* Confirmation message component */}
      {confirmationVisible && (
        <ConfirmationMessage
          message="Are you sure you want to delete this license?"
          onConfirm={handleDelete}
          onCancel={handleCancelDelete}
        />
      )}
    </div>
  );
};

export default BluebookDetails;
